import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

const Step2 = () => {
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [vehicles, setVehicles] = useState([]);

  useEffect(() => {
    const fetchVehicles = async () => {
      try {
        const step2Data = JSON.parse(localStorage.getItem('step2Data'));
        const token = localStorage.getItem('token');

        // Extracting parameters from step2Data
        const { pickupDateTime, returnDateTime, selectedLocation } = step2Data;

        // Format date_from and date_to
        const fromDate = encodeURIComponent(pickupDateTime);
        const toDate = encodeURIComponent(returnDateTime);

        // Constructing URL with parameters
        const url = `https://calm-retreat-90846-cd036e8a822e.herokuapp.com/https://api.rentsyst.com/v2/booking/search?date_from=${fromDate}&date_to=${toDate}&pickup_location=${selectedLocation}&return_location=${selectedLocation}`;

        const response = await axios.get(url, {
          headers: {
            Authorization: `Bearer ${token}`
          }
        });

        console.log('Response data:', response.data);

        // Check if response data and search exist
        if (!response.data || !response.data.vehicles) {
          throw new Error('Invalid response data format');
        }

        // Parse the vehicles from the response
        const parsedVehicles = response.data.vehicles.map(vehicle => {
          const {
            id,
            year,
            number_seats,
            number_doors,
            large_bags,
            small_bags,
            odometer,
            brand,
            mark,
            group,
            color,
            type,
            body_type,
            min_price,
            price,
            status,
            currency,
            consumption,
            fuel,
            volume_tank,
            volume_engine,
            transmission,
            options,
            thumbnail,
            thumbnails,
            photos,
            custom_fields,
            wheel_drive,
            registration_number,
            total_price,
            price_before_discount,
            count_days,
            refill,
            mileage_limit
          } = vehicle;

          return {
            id,
            year,
            number_seats,
            number_doors,
            large_bags,
            small_bags,
            odometer,
            mark: `${brand} ${mark}`,
            group,
            color: {
              title: color.title,
              code: color.code
            },
            type,
            body_type,
            min_price,
            price,
            status,
            currency,
            consumption,
            fuel,
            volume_tank,
            volume_engine,
            transmission,
            options: options.map(option => ({
              id: option.id,
              name: option.name,
              icon: option.icon
            })),
            thumbnail,
            thumbnails,
            photos,
            custom_fields,
            wheel_drive,
            registration_number,
            total_price,
            price_before_discount,
            count_days,
            refill,
            mileage_limit
          };
        });

        // Store the parsed vehicles in the state
        setVehicles(parsedVehicles);
      } catch (error) {
        console.error('Error fetching vehicles:', error);
        setError('Failed to fetch vehicles: ' + error.message);
      } finally {
        setLoading(false);
      }
    };

    fetchVehicles();
  }, []); // Add empty dependency array to useEffect

  console.log('Loading:', loading);
  console.log('Error:', error);
  console.log('Vehicles:', vehicles);

  return (
    <div className="step2-container">
      <img src="/logo.png" alt="Logo" className="logo" />
      {loading && <p>Loading Available Vehicles...</p>}
      {error && (
        <div>
          <p>{error}</p>
          <button onClick={() => window.location.reload()}>Retry</button>
        </div>
      )}
      {!loading && !error && vehicles.length === 0 && <p>No vehicles available</p>}
      {!loading && !error && vehicles.length > 0 && (
        <div className="vehicle-list">
          {vehicles.map(({ id, mark, year, number_seats, number_doors, large_bags, small_bags, odometer, group, color, type, body_type, min_price, price, status, currency, consumption, fuel, volume_tank, volume_engine, transmission, options, thumbnail, thumbnails, photos, custom_fields, wheel_drive, registration_number, total_price, price_before_discount, count_days, refill, mileage_limit }) => (
            <div key={id} className="vehicle-item">
              <div className="vehicle-thumbnail">
                <img src={thumbnail} alt={mark} />
              </div>
              <div className="vehicle-details">
                <h3>{mark}</h3>
                <p>ID: {id}</p>
                <p>Year: {year}</p>
                <p>Number of Seats: {number_seats}</p>
                <p>Number of Doors: {number_doors}</p>
                <p>Large Bags: {large_bags}</p>
                <p>Small Bags: {small_bags}</p>
                <p>Odometer: {odometer}</p>
                <p>Group: {group}</p>
                <p>Color: {color.title} ({color.code})</p>
                <p>Type: {type}</p>
                <p>Body Type: {body_type}</p>
                <p>Minimum Price: {min_price}</p>
                <p>Price: {price}</p>
                <p>Status: {status}</p>
                <p>Currency: {currency}</p>
                <p>Consumption: {consumption}</p>
                <p>Fuel: {fuel}</p>
                <p>Volume Tank: {volume_tank}</p>
                <p>Volume Engine: {volume_engine}</p>
                <p>Transmission: {transmission}</p>
                <p>Options: {options.map(option => option.name).join(', ')}</p>
                <p>Thumbnail: {thumbnail}</p>
                <p>Thumbnails: {thumbnails}</p>
                <p>Photos: {photos}</p>
                <p>Custom Fields: {custom_fields}</p>
                <p>Wheel Drive: {wheel_drive}</p>
                <p>Registration Number: {registration_number}</p>
                <p>Total Price: {total_price}</p>
                <p>Price Before Discount: {price_before_discount}</p>
                <p>Count Days: {count_days}</p>
                <p>Refill: {refill}</p>
                <p>Mileage Limit: {mileage_limit}</p>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default Step2;
